import React from 'react';

const styles = {
  container: {
    textAlign: 'center',
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
    color: 'white',
    backgroundImage: 'url("./background.jpg")', // Add the image as background
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    minHeight: '100vh',
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
    gap: '12px',
    marginTop: '20px',
  },
  input: {
    padding: '10px',
    borderRadius: '6px',
    border: '1px solid #666',
    fontSize: '1rem',
  },
  button: {
    padding: '10px 20px',
    background: 'linear-gradient(90deg, #61dafb, #21a1f1)',
    border: 'none',
    borderRadius: '6px',
    color: 'white',
    cursor: 'pointer',
  },
};

function Feedback() {
  return (
    <div style={styles.container}>
      <header>
        <h2>Feedback</h2>
        <p>We value your feedback! Please share your thoughts below:</p>
        <form style={styles.form}>
          <input type="text" placeholder="Name" required style={styles.input} />
          <input type="email" placeholder="Email" required style={styles.input} />
          <textarea placeholder="How was your experience?" rows="3" required style={styles.input}></textarea>
          <textarea placeholder="Suggestions" rows="5" style={styles.input}></textarea>
          <button type="submit" style={styles.button}>Submit Feedback</button>
        </form>
      </header>
    </div>
  );
}

export default Feedback;
